import React, {useState} from "react";

function App() {
    const [likes, setLikes] = useState(5)
    const [value, setValue] = useState(5)


    function increment() {
        setLikes(likes + 1)
    }

    function decrement() {
        setLikes(likes - 1)
    }


    return (
        <div className="App">
            <h1>{likes}</h1>
            <button onClick={decrement}>Decrement</button>
            <button onClick={increment}>Increment</button>
        </div>
    );
}

export default App;
